function ArticleCard(props) {
  return(
    <div class="col-12">
      <div class="row"><div class="card card-article" key={props.id}>
       <img class="img-fluid img-article" src={props.thumbnail} alt="..."/>
       <div class="card-body">
         <h5 class="card-title">{props.title}</h5>
       <p class="card-text">{props.snippet}</p>
        <p class="card-text"><small class="text-muted">{props.date}</small></p>
       </div>
      </div></div>
    </div>
  );
}

export default ArticleCard;
